  return (
    <div>
      <div>Date</div>
      <div>
        <h2>New words</h2>
        <div>Amount</div>
      </div>
    </div>
  );
}

// 2 - Congrats now u need to export it and import
// it in App.js which is root component for app
export default ExpenseItem;
